// src/App.tsx
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './pages/Home';
import Profile from './components/ProfileModal';
import Login from './pages/Login'; // Adicione esta página se estiver separando a página de login
import Register from './pages/Register'; // Adicione esta página se estiver separando a página de registro
import Header from './components/Header';
import LoginModal from './components/LoginModal';

const App: React.FC = () => {
  return (
    <Router>
      <Header />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/profile" element={<ProfileModal />} />
        <Route path="/login" element={<LoginModal />} /> {/* Página de login */}
        <Route path="/register" element={<Register />} /> {/* Página de registro */}
      </Routes>
    </Router>
  );
};

export default App;
